posts.description:
We out here culture hoppin...

@mojo_club is next in Hamburg.

This is hard work but it feels really good. Kind of like planting crops and watching them grow. @sowhatsnextfestival was insane and we got to chop it up with a plethora of incredible groups and thinkers. Special shout out to @imjoelmross @_imjeremydutton_ @josejamesmusic @steamdown @chrisfishmanmusic @ashleykahn1600 and a bunch of other cats that I can't think of right now. Check out kassaoverall.com to see if we are coming to a city near you. I brought merch. @finkianfink just got @kfc @bendjiallonce
